    }

    render() {
        var names = ["我的世界", "你好", "简体"];
        var tabButtons = []
        for (var i = 0; i < names.length; i++)
            tabButtons.push(
                () => {
                    const sid = "tableButton" + i;
                    return(
                        <TabButton buttonName= {names[i]}  id={sid} onClick={() => this.clickTabButton(i)} />
                    );

                }
            )

        if (this.state.count %2 == 0){
            return (
                <div>
                <TabButton buttonName = "1" onClick = {this.clickTabButton(i)}/>
                <header>12312312</header>
                {tabButtons}
                <button name="cool" onClick={() => {
                    var count = this.state.count + 1
                    this.setState({count:count})
                }}>cool</button>
                <body>
                    hello js
                </body>
                <body>icount is {this.state.count}</body>
                <input type="button"></input>
                <pre class="lua">
                <code>
                    <text>function</text>()<br></br>
                    return
                    end
                </code>
                </pre>
                </div>
            );
        }
        else{
            return (
                <div>
                <header>12312312</header>
                <button name="cool" onClick={() => {
                    var count = this.state.count + 1
                    this.setState({count:count})
                }}>cool</button>
                <body>哇哈哈哈
                </body>
                <body>icount is {this.state.count}</body>
                </div>
            );
        }
    }
}

ReactDOM.render(<Show/>, document.getElementById('root'))

